import React from 'react';

export const DataEntry = (props) => {
  const { dataEntry } = props;

  const date = [new Date(), new Date()];
  let t = dateEntry.ping_date.split(/[- :]/);
  let d = new Date(Date.UTC(t[0], t[1]-1, t[2], t[3], t[4], t[5]));

  // if (dataEntry.ping_date >= dateRange[0] && dataEntry.ping_date <= dateRange[1]) {
    return (
          <tr>
            <td>{dataEntry.realMac}</td>
            <td>{dataEntry.Pi_SpoofedMac}</td>
            <td>{dataEntry.AP_name}</td>
            <td>{dataEntry.AP_bssid}</td>
            <td>{dataEntry.gateway_addr}</td>
            <td>{dataEntry.google_ping_ms}</td>
            <td>{dataEntry.DNS_ping_ms}</td>
            <td>{dataEntry.gateway_ping_ms}</td>
            <td>{dataEntry.HTTP_PING_ms}</td>            
            <td>{dataEntry.RSSI_dBm}</td>
            <td>{dataEntry.Signal_in_percent}</td>
            <td>{dataEntry.RF_hz}</td>
            <td>{dataEntry.authTime_sec}</td>
            <td>{dataEntry.ping_date}</td>
          </tr>
    )
  // }
}

export default DataEntry;
